    false,nt"url": null,nt"notes": "This annual narrative report for National
    Elk Refuge outlines Refuge accomplishments during the 1982 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management planning, public participation, and research and investigation. Refuge
    administration is outlined; information about personnel, youth programs, volunteer
    programs, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include wetlands, grasslands, grazing, haying, fire management,
    pest control, and water rights. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, migratory birds, raptors, game mammals,
    fisheries resources, marking and banding, and disease prevention and control. The
    public uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, recreational uses, and law enforcement. The equipment and facilities section
    of the report provides information about new construction, rehabilitation, major
    maintenance, equipment utilization and replacement, communication systems, and energy
    conservation. Cooperative programs and items of interest are provided at the end.
    Photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
